import React from "react";
import "./App.css";

import NavigationBar from "./components/NavigationBar/NavigationBar";

import wildfire from "./assets/wildfire.gif";

function App() {
  return (
    <div>
      <NavigationBar />
      <img src={wildfire} />
    </div>
  );
}

export default App;
